import Form from 'react-bootstrap/Form';
import React from 'react';
import Button from 'react-bootstrap/Button';
import {useNavigate} from 'react-router';
import { Card } from 'react-bootstrap';

const SignUp = () => {

    const navigate = useNavigate();

    const GoToSignIn=()=>{
        navigate('/')
    }

    return (
        <div className="background_signin">
            <Card border="success" style={{ width: '18rem' }} className="card_signin">
                <Card.Header className="cityty_style">Cityty</Card.Header>
                    <Card.Body>
                        <Form>
                            <Form.Group className="mb-3" controlId="formBasicEmail">
                                <Form.Label>Email address</Form.Label>
                                <Form.Control type="email" placeholder="Enter email" />
                            </Form.Group>

                            <Form.Group className="mb-3" controlId="formBasicPassword">
                                <Form.Label>Password</Form.Label>
                                <Form.Control type="password" placeholder="Password" />
                            </Form.Group>

                            <Form.Group className="mb-3" controlId="formBasicPassword">
                                <Form.Label>Confirm your password</Form.Label>
                                <Form.Control type="password" placeholder="Confirm your password" />
                            </Form.Group>

                            <Button variant="primary" type="submit">
                                Submit
                            </Button>

                        </Form>
                        <div className="container-button_form">
                            <Button variant="link" className="button_form" onClick={()=>GoToSignIn()} >Back</Button>
                            <Button variant="link" className="button_form" >Sign Up</Button>
                        </div>
                </Card.Body>
            </Card>
        </div>
    );
};

export default SignUp;
